import React from 'react'

function DisplayInfo(props) {
    return (props.infoTrigger)?(
        <p>
            <b>App Name: </b><i>{props.appInfo.appName}</i>
            <br/>
            <b>Store Name: </b><i>{props.appInfo.storeName}</i>
            <br/>
            <b>Bundle Id: </b><i>{props.appInfo.bundleId}</i>
            <br/>
            <b>Server: </b><i>{props.appInfo.server}</i>
            <br/>
        </p>
            
    ):"";
}

export default DisplayInfo
